@amarkula Yes but there generally are longer, descriptive strings in the apps too that can provide more information and to use aliases you also need to have a certain level of understanding anyway (you must have an account with some supported alias provider and you need a personal API key from that account to link it to Bitwarden).

If we were to force this into some more Finnish sounding it would also lessen our ability to search for more information like official support materials. Note that for example Microsoft, Google and Apple use "alias" in their official, Finnish localization (as evidenced by a simple "aliasosoite" search).

For the record, alias is in many Finnish dictionaries although I do not have any knowledge of its heritage or official status. It rarely appears in common tongue but that is true to many Finnish words that have been around for ages.

